export const RegisterUser = async (data) => {
  try {
    const res = await Client.post('auth/register', data)
    return res.data
  } catch (error) {
    throw error
  }
}

export const CheckSession = async () => {
  try {
    const res = await Client.get('auth/session')
    return res.data
  } catch (error) {
    throw error
  }
}
